import React from "react";
import Card from "../UI/Card";

const AppSys = (props) =>{
    
    const ddd = () =>{
        console.log(props.role);
        return props.role===1?
        <Card>
        <div>
        <p>Welcome to out new Application</p>
    </div>
    </Card>:
    <div></div>   
    }
    
    return (<div>{ddd()}</div>
    )
}

export default AppSys;
